export const Header = () => {
    return (
        <header>

            <nav className="bg-white border-gray-200 dark:bg-gray-900">
                <div className="flex flex-wrap justify-between items-center mx-auto max-w-screen-xl p-4">
                    <a href="" className="flex items-center">
                        <img src="" className="h-8 mr-3" alt="Code Book"/>
                        <span
                            className="self-center text-2xl font-semibold whitespace-nowrap dark:text-white">CodeBook</span>
                    </a>
                    <div className="flex items-center">
                        <a href="tel:5541251234"
                           className="mr-6 text-sm  text-gray-500 dark:text-white hover:underline">(555) 412-1234</a>
                        <a href="#" className="text-sm  text-blue-600 dark:text-blue-500 hover:underline">Login</a>
                    </div>
                </div>
            </nav>


        </header>
    );
};
